                    __html: `
                @import url('https://fonts.googleapis.com/css2?family=Orbitron:wght@400;700&family=Noto+Sans+Myanmar:wght@400;700&display=swap');

                :root {
                    --neon-gold: #d4af37;
                    --neon-gold-light: #f3cf65;
                    --dark-bg: #0a0a0a;
                    --glass-bg: rgba(255, 255, 255, 0.05);
                    --glass-border: rgba(255, 255, 255, 0.1);
                }

                body {
                    font-family: 'Noto Sans Myanmar', sans-serif;
                    background: var(--dark-bg);
                    overflow-x: hidden;
                }

                .orbitron { font-family: 'Orbitron', sans-serif; }

                /* Floating Action Buttons */
                .float-btn {
                    width: 60px;
                    height: 60px;
                    border-radius: 50%;
                    display: flex;
                    align-items: center;
                    justify-content: center;
                    transition: all 0.3s cubic-bezier(0.175, 0.885, 0.32, 1.275);
                    box-shadow: 0 10px 25px rgba(0,0,0,0.5);
                    color: white;
                }

                .viber-btn { background: linear-gradient(135deg, #7360f2, #5948cc); }
                .telegram-btn { 
                    background: linear-gradient(135deg, #0088cc, #0077b5); 
                    animation: bounce 2s infinite;
                }

                .float-btn:hover {
                    transform: scale(1.15) rotate(5deg);
                }

                @keyframes bounce {
                    0%, 100% { transform: translateY(0); }
                    50% { transform: translateY(-10px); }
                }

                /* Layout Utilities */
                .glass {
                    background: var(--glass-bg);
                    backdrop-filter: blur(12px);
                    border: 1px solid var(--glass-border);
                }

                /* Marquee Styling */
                .marquee-container {
                    background: #111;
                    border-bottom: 1px solid var(--neon-gold);
                    padding: 8px 0;
                }

                @media (max-width: 768px) {
                    .float-btn {
                        width: 52px;
                        height: 52px;
                    }
                }
                `
